import os
import sys
from utils_tools.JSONTools import Config

from datetime import datetime
from PyQt5.QtCore import Qt, pyqtSignal
from PyQt5.QtWidgets import QWidget, QApplication
from ui.gen_report import Ui_WgtGenReport
from run_ui.run_single_hole_display import Ui_WgtSingleHoleDisplayAction


class Ui_WgtGenReportWinAction(QWidget, Ui_WgtGenReport):
    single_vid_info_received_signal = pyqtSignal(dict)
    vid_name_received_signal = pyqtSignal(str)

    def __init__(self):
        QWidget.__init__(self)
        Ui_WgtGenReport.__init__(self)
        self.setupUi(self)
        self.setAttribute(Qt.WA_StyledBackground, True)  # 激活背景
        self.btn_resolve_clicked_count = 0
        self.single_vid_info_received_signal.connect(self.fill_received_data)
        self.vid_name_received_signal.connect(self.fill_data_by_vid_name)

    def fill_received_data(self, single_vid_data):
        """
        {
        "base_infos": {
            "vid_path": "D:/PycharmWorkspaces/HoleRecog1/run_ui/video01.avi",
            "well_name": "1",
            "well_inner_radius": "1",
            "vid_gen_time": "2023-8-30",
            "cam_outer_radius": "1",
            "vid_gen_place": "1",
            "engineer": "1",
            "resolve_person": "admin",
            "resolve_time": "2023-8-30",
            "hole_number": "10"
        },
        "hole_infos": {
            "hole0001": {
                "hole_id": "\u5b54\u6d1e1",
                "start": 24,
                "end": 47,
                "duration": 1,
                "width_pixel": 21.62,
                "height_pixel": 20.96,
                "width": 463.79,
                "height": 449.49,
                "area": 163731.14,
                "depth": 0,
                "img_str": "",
                "from": 0
            },
            ...
        }
        """
        # 填充基本信息
        vid_info = single_vid_data["base_infos"]
        print("[run_gen_report.fill_received_data]recevice: ", vid_info)
        title = "%s报告" % os.path.basename(vid_info['vid_path']).split(".")[0]
        self.setWindowTitle(title)
        self.label_report_title.setText(title)
        self.lab_well_name_display.setText(vid_info['well_name'])
        self.lab_well_inner_radius_display.setText(vid_info['well_inner_radius'])
        self.lab_file_name_display.setText(vid_info['vid_path'])
        self.lab_vid_gen_time_display.setText(vid_info['vid_gen_time'])
        self.lab_vid_gen_place_display.setText(vid_info['vid_gen_place'])
        self.lab_engineer_display.setText(vid_info['engineer'])
        self.lab_cam_outer_radius_display.setText(f"{vid_info['cam_outer_radius']} mm")
        self.lab_analyser_display.setText(vid_info['resolve_person'])
        self.lab_analysis_time_display.setText(vid_info['resolve_time'])
        self.lab_hole_count_display.setText(vid_info['hole_number'])

        # 填充孔洞信息
        count = 0  # 当前遍历的数量
        line = 2  # 一行显示的数量
        hole_infos = single_vid_data["hole_infos"]
        for key, val in hole_infos.items():
            hole_info = hole_infos[key]
            report_forms = Ui_WgtSingleHoleDisplayAction()
            report_forms.draw_hole_info(hole_info)
            # self.gid_holes_display.addWidget(report_forms, count // line, count % line)
            self.gid_holes_display.addWidget(report_forms, count // line, count % line)
            count += 1

    def fill_data_by_vid_name(self, vid_name):
        vid_datas = Config.read_vid_info()
        single_vid_data = vid_datas[vid_name]
        self.fill_received_data(single_vid_data)

